INSERT IGNORE INTO `products` (`id`, `created_at`, `created_by`, `updated_at`, `updated_by`, `is_deleted`, `description`, `is_featured`, `name`, `price`, `slug`, `category_id`) VALUES (1,'2024-11-28 10:26:21.947957','admin@gmail.com','2024-11-28 10:26:22.027124','admin@gmail.com',_binary '\0','Áo khoác mỏng bằng sợi lụa nhân tạo pha trộn, dệt kim mịn, mềm, khuy dọc thân trước và gân nổi ở viền cổ, cổ tay và gấu áo.',_binary '\0','Áo khoác mỏng dệt kim mịn',299000,'ao-khoac-mong-det-kim-min-1',1),(2,'2024-11-28 10:26:32.789817','admin@gmail.com','2024-11-28 10:26:32.833348','admin@gmail.com',_binary '\0','Áo jumper dáng rộng dệt kim mềm với cổ tròn, viền gân nổi, vai ráp trễ và tay dài. Cổ tay và gấu bo gân nổi.',_binary '\0','Áo jumper',399000,'ao-jumper-2',1),(3,'2024-11-28 10:26:36.698184','admin@gmail.com','2024-11-28 10:26:36.714499','admin@gmail.com',_binary '\0','Áo măng tô maxi dáng rộng bằng vải xù mềm có ve chữ V, khuy bấm ẩn ở eo và túi chìm hai bên. Có lớp lót.',_binary '\0','Áo măng tô maxi lông xù',1999000,'ao-mang-to-maxi-long-xu-3',2),(4,'2024-11-28 10:26:41.600511','admin@gmail.com','2024-11-28 10:26:41.625068','admin@gmail.com',_binary '\0','Áo khoác trenchcoat ngắn, hai hàng khuy dệt chéo có lá cổ, ve chữ V, khuy ở phía trước và đai vai cài khuy. Dáng thụng với tay dài, ráp lăng, đai và khuy ở cổ tay, túi chéo mổ viền ở thân trước. Không có lớp lót.',_binary '\0','Áo khoác trenchcoat ngắn',799000,'ao-khoac-trenchcoat-ngan-4',2),(5,'2024-11-28 10:26:45.995888','admin@gmail.com','2024-11-28 10:26:46.034950','admin@gmail.com',_binary '\0','Áo kiểu cổ chữ V bằng vải dệt thoi hơi óng ánh. Có cổ, khuy dọc thân trước, tay dài với nẹp tay áo, măng sét cài khuy và vạt áo tròn.',_binary '\0','Áo kiểu cổ chữ V',399000,'ao-kieu-co-chu-v-5',3),(6,'2024-11-28 10:26:50.050593','admin@gmail.com','2024-11-28 10:26:50.079597','admin@gmail.com',_binary '\0','Áo kiểu dáng rộng bằng cotton mềm dệt thoi có cổ Tàu, phần mở chữ V phía trước và tay dài ráp lăng kiểu bóng bay với măng sét cài khuy. Vạt tròn với thân sau hơi dài hơn.',_binary '\0','Áo kiểu tay bóng bay',499000,'ao-kieu-tay-bong-bay-6',3),(7,'2024-11-28 10:26:53.898554','admin@gmail.com','2024-11-28 10:26:53.922542','admin@gmail.com',_binary '\0','Quần jean 5 túi bằng denim dày dặn làm từ cotton và viscose pha. Cạp cao, nẹp che khuy và ống suông.',_binary '\0','Straight Jeans',899000,'straight-jeans-7',4),(8,'2024-11-28 10:26:57.802049','admin@gmail.com','2024-11-28 10:26:57.836584','admin@gmail.com',_binary '\0','Quần jean bằng denim hơi co giãn mang lại cảm giác thoải mái. Ống loe với dáng ôm gọn từ cạp cho tới đùi và dáng loe từ đầu gối xuống tới gấu. Cạp trễ với nẹp khoá kéo và khuy. Túi trước giả, một túi đựng tiền xu và túi sau mở. Chiều dài vừa phải, được thiết kế để vừa chạm tới bàn chân và không bị chùng. Một biểu tượng thời trang từ thập niên 70 cho tới nay.',_binary '\0','Flared Low Jeans',499000,'flared-low-jeans-8',4),(9,'2024-11-28 10:27:01.834691','admin@gmail.com','2024-11-28 10:27:01.856687','admin@gmail.com',_binary '\0','Quần short giả váy ngắn bằng vải dệt thoi có cạp cao và thân trước đáp chéo cài ở một bên. Khoá kéo ẩn và khóa móc cài ở một bên cùng túi mổ viền giả phía sau.',_binary '\0','Quần short giả váy mini',499000,'quan-short-gia-vay-mini-9',5),(10,'2024-11-28 10:27:06.671180','admin@gmail.com','2024-11-28 10:27:06.689182','admin@gmail.com',_binary '\0','Chân váy mini bằng vải lưới đính kim sa có cạp cao với ly chiết định hình ở phía sau và khoá kéo ẩn và cài khoá móc ở một bên. Có lớp lót.',_binary '\0','Chân váy mini đính kim sa',799000,'chan-vay-mini-dinh-kim-sa-10',5),(11,'2024-11-28 10:27:11.352268','admin@gmail.com','2024-11-28 10:27:11.366292','admin@gmail.com',_binary '\0','Áo hoodie dáng rộng bằng vải nỉ có hoạ tiết in và mặt trái chải xù mềm. Mũ lót vải jersey có dây rút, túi kangaroo, vai ráp trễ nhiều và tay dài. Cổ tay và gấu bo gân nổi.',_binary '\0','Áo hoodie có hoạ tiết',699000,'ao-hoodie-co-hoa-tiet-11',6),(12,'2024-11-28 10:27:16.601356','admin@gmail.com','2024-11-28 10:27:16.627370','admin@gmail.com',_binary '\0','Áo hoodie dáng rộng bằng vải nỉ có hoạ tiết in và mặt trái chải xù mềm. Mũ lót vải jersey có dây rút, túi kangaroo, vai ráp trễ nhiều và tay dài. Cổ tay và gấu bo gân nổi.',_binary '\0','Áo hoodie lửng kéo khoá',399000,'ao-hoodie-lung-keo-khoa-12',6);
